import * as React from 'react';
import { Avatar, Button, Card, Title, Paragraph } from 'react-native-paper';

const Pokemon = (props) => {
        const {pokemon} = props;

        return (
            <div>
                {
                    pokemon.map((val, idx) => {
                        <p key={idx}> {val.name}</p>
                    })
                }
            </div>
        )
     
    
}

export default Pokemon;
